import React from 'react';
import OnepageMenu from '../components/OnepageMenu';
import DevOpsBanner from '../components/Banner/DevOpsBanner';
import HowDevOpsWorks from '../components/Process/HowDevOpsWorks';
import JobsTab from '../components/JobsTab';


const Jobs = () => {
    return(
        <div className="body_wrapper menu_white">

            <OnepageMenu 
                    menu_txt1= "menu_txt1" menu_txt2= "menu_txt2" menu_txt3= "menu_txt3" 
                    menu_txt4= "menu_txt4" menu_txt5= "menu_txt5" menu_txt6= "menu_txt6" 
                    menu_logo= "menu_logo" menu_txt7= "menu_txt7" /> 
            {/* <DevOpsBanner /> */}
            <JobsTab />
            <HowDevOpsWorks/>

        </div>
    )
}
export default Jobs;
